  return (
    <>
      <div className="staffonboarding_1">
        <div className="container-fluid staffonboarding_2">
          <div className="row ">
            <div className="col-md-2 staffonboarding_3">
              <div className=""> MediPharm Assistant</div>
            </div>
            <div className="col-md-9">
              <div>Staff Onboarding</div>
              <div className="">Create users and assign role them</div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};
export default StaffOnboarding;
